/*Table structure for table `slot_booking` */

DROP TABLE IF EXISTS `slot_booking`;

CREATE TABLE `slot_booking` (
  `booking_id` int(255) NOT NULL AUTO_INCREMENT,
  `bunk_id` int(255) DEFAULT NULL,
  `user_id` int(255) DEFAULT NULL,
  `licenceNumber` varchar(1000) DEFAULT NULL,
  `slot_number` varchar(120) DEFAULT NULL,
  `booking_time` varchar(200) DEFAULT NULL,
  `booking_status` varchar(250) DEFAULT NULL,
  `qr_status` varchar(250) DEFAULT NULL,
  `b_id` int(255) DEFAULT NULL,
  PRIMARY KEY (`booking_id`)
